        3 : "YouTube"
    }

        return(
            <div>
                <ul>
                    <li>
                        <input type="checkbox" /> {repo[1]}
                    </li>
                    <li>
                        <input type="checkbox" /> {repo[2]}
                    </li>
                    <li>
                        <input type="checkbox" /> {repo[3]}
                    </li>
                </ul>  

            </div>
        )
}

export default Allsocial
